import React from "react";
import NavBar from "../components/NavBar";
import '../styles/images-styles.css'
import '../styles/text-styles.css'
import '../styles/utility-styles.css'
import Building from '../assets/Building.png'
import Contacts from "./Contacts";
import { Card, Col, Container, Row } from "react-bootstrap";

const Structure = () => {
    return (
        <>
        <NavBar/>
        <div className="display-1 mt-4">О центре</div>
        <Container className="mt-5">
            <Row>
                <Col className="col-3">
                    <Card style={{border:'none'}}>
                    <Card.Img variant="top" src={Building} style={{maxWidth:'306px'}}alt='Здание'/>
                    <div className="image-Deco">
                            
                                <div className="gradient mb-3" style={{height:'9px', maxWidth:'50%'}}/>
                            
                        </div>
                        </Card>
                </Col>
            </Row>
        </Container>
        </>
    );
};

export default Structure;
